">2015</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.25</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>在丈夫欠下鉅額債務跑路後，奈奈子遭高利貸老闆控制，日日夜夜被要求服侍前來的客戶，並用手銬將她監禁在家中被男人視為玩物的奈奈子身心遭到玷汙，悲慘至極的同時卻同時感受到快感……</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/97097/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/14144/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2017-04-03/201704031491231614.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">2.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/14144/">妻子的通奸2</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%ED%95%98%EC%A6%88%ED%82%A4%EB%85%B8%EC%A1%B0%EB%AF%B8------------/" target="_blank">하즈키노조미</a>&nbsp;<a href="/s/-%EC%95%84%EC%98%A4%EC%9D%B4%EC%9C%A0%EC%9A%B0%ED%83%80------------/" target="_blank">아오이유우타</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%EA%B9%80%EB%AF%BC%EC%8B%9D--------/" target="_blank">김민식</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%9F%A9%E5%9B%BD-----------/" target="_blank